function convertMonthYearToDate(monthYear) {
  if (!monthYear) return null;
  const months = [
    "Jan",
    "Feb",
    "Mar",
    "Apr",
    "May",
    "Jun",
    "Jul",
    "Aug",
    "Sep",
    "Oct",
    "Nov",
    "Dec",
  ];
  const [monthStr, year] = monthYear.split(" ");
  const month = months?.indexOf(monthStr) + 1;
  return `${year}-${month.toString().padStart(2, "0")}-01`;
}
